wn','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1237,'DaDz','SGT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1238,'DeathereX','1LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1239,'Sent','SSG',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1240,'Gobbler','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1241,'SifTheAbyss','SGT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1242,'Sharky','LTC',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1243,'Struzi','1LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1244,'Andu','2LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1245,'Aftershow','GSG',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1246,'Bolinho','2LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1247,'Deaden','SGT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1248,'epicness','SGT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1249,'Yellowflyer','SGT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1250,'Phenom','MGN',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1251,'JordonDummy','BGN',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1252,'MaverickSabre','LTC',76561198084983522,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.03.18.18/4TWR00HKJ46Z.png','active','2012-01-03 00:00:00','2016-09-18 13:34:41','gb-eng','I first joined TAW in January 2012, under the callsign Edd, and into 2nd Battalion, Arma II Division. Ever since joining I&#39;ve been impressed with the huge scope of games that TAW has such a massive part in. I&#39;ve been able to involve myself with other Divisions ever since, practicing with people that play other games that, whilst aren&#39;t my main focus, are still part of the variety that makes gaming what it is.\r\n&nbsp;\r\nI went on to be Commanding Officer of Planetside&#39;s 4th Battalion, and was involved with the team since the game was in beta. The usual casual approach taken by the other outfits in Planetside see TAW on an uncomfortable and rocky road. Our rules and policies could easily be taken as over the top and extreme. However, we were looked upon, despite our size, as a formidable tactical force. We were welcomed for our differences and whilst our numbers had, and will always remain low amongst our peers, we were held in the highest regard for our impressive teamwork, energy and enthusiasm. In a game as fast paced and unforgiving as Planetside 2 we have been able to demonstrate some of our biggest strengths.\r\n&nbsp;\r\nAfter my time in PS I went back to where I belong in 2nd Battalion Arma III Division as Commanding Officer. Arma is an exciting sandbox platform for which boundaries are only limited by our creativity. The most impressive part of this division is how well it is suited to TAW as an organisation. Never before have I witnessed such a well oiled machine both on Battalion and Division level. It&#39;s an exciting and challenging role and doing it for nearly 2 years was an incredible experience.\r\n&nbsp;\r\nI spent a short spell in Sentinel, and had the honour of leading a TAW University on Leadership Styles among Leadership blogs and other things. I am now the Division Commander of Arma III. It&#39;s a privilege to lead such a prestigious, and one of the flagship divisions in TAW, and a pleasure to work alongside the dedicated members that have offered so much to our community over many years of service.\r\n&nbsp;\r\nThe best thing about TAW is the members, there&#39;s no doubt about that. Everybody shares the common love of gaming, and every Division, Battalion and Squad has the same love of Teamwork and Fair Play. Long may it continue.'),(1253,'hadesdaman','LTC',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1254,'Aristenn','MGS',76561198040873621,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.06.40.68/4TU6GRJ27B0Z.jpg','active','2015-01-30 00:00:00','2016-09-18 13:34:57','',''),(1255,'Constance','CPT',76561198059003787,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.04.21.06/4TPT3O8TRHD2.jpg','active','2013-02-13 00:00:00','2016-09-18 13:35:00','','&quot;Regard your soldiers as your children, and they will follow you \r\ninto the deepest valleys; Look on them as your own beloved sons, and \r\nthey will stand by you even unto death..&quot; -Sun Tzu, The Art of War\r\n&nbsp;\r\nPositions Held (ARMA Division)\r\nDrill Instructor, 1st Battalion (North American), ARMA II -- [04-13]\r\nDrill Instructor, 3rd Battalion (ACE &amp; ACRE), ARMA II -- [04-13]\r\nStaff Officer, 1st Battalion (North American), ARMA II &amp; III -- [06-13]\r\nExecutive Officer, 1st Battalion (North American), ARMA III -- [09-13]\r\nCommanding Officer, 1st Battalion (North American), ARMA III -- [10-13]\r\nDivision Officer, ARMA III -- [02-14]\r\n--\r\nStaff Officer, 1st Battalion (North American), ARMA III -- [08-14]\r\n2nd Platoon Leader, 1st Battalion&nbsp; (North American) -- [12-14]\r\nExecutive Officer, 1st Battalion (North American) -- [12-14]\r\nCommanding Officer, 1st Battalion (North American) -- [04-15]'),(1256,'Deceded','MSG',76561198058701412,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.04.25.78/4TPXDBIWAJUG.jpg','on leave','2013-02-28 00:00:00','2016-09-18 13:35:31','ca','There are no Easter Eggs here\r\n--\r\n22/06/2013 - Assigned as DI\r\n05/09/2013 - Assigned as SO\r\n13/10/2013 - Assigned as XO\r\n09/03/2014 - Assigned as CO\r\n10/06/2014 - Assigned as DO\r\n16/06/2015 - Honorable Discharge\r\n16/09/2015 - Reinstated\r\n14/10/2015 - Assigned as TI\r\n16/10/2015 - Assigned as TS\r\n15/03/2016 - Assigned as XO\r\n06/07/2016 - Stepped down from XO\r\n06/07/2016 - Took lead of 2nd Platoon\r\n06/07/2016 - Requested demotion to lower rank for PL'),(1257,'Greed','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1258,'KingBee','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1259,'louderthanu','2LT',76561198018669112,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.01.60.37/4TQIG92ITA8E.jpg','active','2011-03-04 00:00:00','2016-09-18 13:35:03','',''),(1260,'Plum','GSG',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1261,'Rify','2LT',0,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.00.35.03/4TMZ3CIV17GP.jpg','on leave','2010-02-06 00:00:00','2016-09-18 13:35:05','se','In Sweden born and raised.&nbsp;I live just a few miles below the polar circle with my girlfriend and two cats. I&#39;m currently in college studying a master&#39;s programme in industrial engineering which can prove very time consuming and as a result devours most of my life.\r\n&nbsp;\r\nReal life me sure is boring. As for gaming-me, I was lucky enough to stumble upon TAW late 2007 while searching for a clan to play Battlefield with. Since then I&#39;ve been on and off.'),(1262,'TBone','MGN',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1263,'WileyX','2LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1264,'Xsage','LTC',76561198067161690,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.03.68.22/4TVW1830ZE1Y.png','active','2012-09-04 00:00:00','2016-09-18 13:35:07','gb',''),(1265,'Cannas','1LT',0,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.01.78.73/4TJK6KC4PZXD.png','active','2011-06-01 00:00:00','2016-09-18 13:35:40','pt',''),(1266,'Katsune','2LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1267,'Lucky','BGN',76561197970848093,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.00.74.83/4TW91KLZU1X1.jpg','active','2010-08-02 00:00:00','2016-09-18 13:34:48','','I&#39;ve been a games lover since I was a kid playing Stratego and Risk. It reached one new level when I was in 9th grade and discovered Avalon Hill&#39;s Panzer Blitz (in 1975). That lead to other wargames like Richtoffen&#39;s War, Stalingrad, Gettysburg, Wooden Ships and Iron Men, Starship Troopers, Gladiator, and Advanced Squad Leader. Then came RPGs when I found Chainmail and the then-new Dungeons and Dragons. \r\n&nbsp;\r\nA couple years later, I played my first &quot;computer game&quot; when a college student friend brought home an acoustic coupler modem, keyboard and dot-matrix printer rig. He connected it to my phone and dialed into the MIT computers to get us playing what was called Adventure then (it was later commercialized and became Zork, by Infocom, a company where I almost worked in 1981). Computer gaming took it all to an amazing new level. I was hooked for life.\r\n&nbsp;\r\nBut I also kept exploring other forms of gaming. In 1990, I tried a Live Action Role-Playing Game (the original NERO group), and found that to be an incredible blast. In 1995, when the founders of Legends Roleplaying decided to sell it, two friends and I bought it. I ran it for three years, and that only stopped when I left Massachusetts to move to Arizona (and then California). \r\n&nbsp;\r\nAnd I&#39;m not just a player; I started creating content as a &quot;DM&quot; back in the 70s. Today, having the digital tools to create missions or adventures (etc.) is a dream. And I still spend many, many hours creating missions for the Arma division in TAW!\r\n&nbsp;\r\nOn Arma &amp; Realism\r\nOpen For Business!'),(1268,'Wer','SSG',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1269,'davidglennbailey','PFC',76561198059005745,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.81.71/4TXZF86R1YG9.jpg','active','2016-04-19 00:00:00','2016-09-18 13:36:53','',''),(1270,'DoubleDown','1SG',76561197970570415,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.05.97.97/4TYKCI26MDM5.jpg','active','2014-09-04 00:00:00','2016-09-18 13:35:09','','You have to challenge your squad, push them to learn new skills and apply those skills during missions. Once they feel they are being successful, their enjoyment of the game and engagement in the community will increase. From a naturally skilled player to one that struggles with the base mechanics, if you can get them to improve over yesterday, that is a victory.'),(1271,'Blackbox','SGT',76561198041404800,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.24.06/4TXR4IN2XQOC.jpg','active','2015-10-08 00:00:00','2016-09-18 13:35:55','ca','Can literally not be stopped based upon Newtonian physics.\r\n&nbsp;\r\nFull takeover of the global economy coming soon.\r\n&nbsp;\r\nPositions held:\r\nAlpha FL\r\nAlpha SL\r\nAM1 DI\r\n1st PL'),(1272,'BetaHook','SGT',76561198016885807,'http://taw.net/utility/anonymous.gif','active','2016-02-15 00:00:00','2016-09-18 13:35:59','',''),(1273,'FloBurner','2LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1274,'Guthrie','SGT',0,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.21.75/4TW8NU00CVXQ.jpg','active','2015-10-03 00:00:00','2016-09-18 13:36:01','ca',''),(1275,'lalt','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1276,'Monolion','SGT',76561198052946029,'http://taw.net/utility/anonymous.gif','active','2015-10-16 00:00:00','2016-09-18 13:36:03','',''),(1277,'MToone','MSG',0,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.29.96/4TWJD1UV9RQI.jpg','active','2015-11-01 00:00:00','2016-09-18 13:35:53','',''),(1278,'Nate','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1279,'whiteworm','SGT',76561198059158711,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.24.59/4TZ5OGYOT1BM.jpg','active','2015-10-10 00:00:00','2016-09-18 13:36:05','',''),(1280,'UselessDewey','GSG',76561198022080620,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.25.92/4TXE0XOQXHD8.jpg','active','2015-10-15 00:00:00','2016-09-18 13:36:07','','Things and stuff and other things, but not other stuff.\r\nGo one deeper with me.'),(1281,'Jarhead','GSG',76561198064881351,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.01.61.44/4TS3GTO2CTV8.jpg','active','2011-03-11 00:00:00','2016-09-18 13:36:18','','in order to be the best you got to be different from all the rest'),(1282,'DivadSesom','SGT',76561198001759271,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.28.73/4TWK81TP6BS2.jpg','active','2015-10-25 00:00:00','2016-09-18 13:36:20','','My name is David actually. &nbsp;I&rsquo;ve used the call sign DivadSesom for more than two decades because I&rsquo;ve found the player name is never taken. &nbsp;I served in the USAF with the 48th CRS at RAF Lakenheath between 85 &ndash; 89 repairing jet engines on the F-111. &nbsp;After leaving the service I got my A&amp;P license and hired on with a major US airline.\r\n&nbsp;\r\nComputers and electronics have always been a hobby of mine. &nbsp;I got my first computer in 1979. &nbsp;Let me tell you, the TI-99/4A was a screamer with its 16-bit processor back in the day. &nbsp;My mechanical troubleshooting aptitude along with mad computer skills eventually lead me to my current job serving as director of an IT department.\r\n&nbsp;\r\nI&rsquo;ve always enjoyed the FPS genre, but have never been very good at them. &nbsp;I started with Doom, tried some Quake, and then found Soldier of Fortune in 2000. &nbsp;I enjoyed SoF&rsquo;s attempt at realism but with three small rug rats to raise I didn&rsquo;t have a lot of time to devote to computer games (especially ones that featured exploding headshots). &nbsp;I dabbled with some UT2004 and even ran a dedicated Unreal server for about a year until I got tired of dealing with 12 year old shenanigans on the server &ndash; plus they all seemed to be better than me (perhaps I was getting older and my reflexes just weren&rsquo;t what they used to be).\r\n&nbsp;\r\nI then found Guild Wars in 2005 and left the FPS world for MMO&rsquo;s for the next ten years aside from the occasional Halo sessions with my kids on Xbox. &nbsp;I tried CoD and Battlefield, but they just didn&rsquo;t have the same appeal to me as SoF. &nbsp;During a recent LAN party, my kids &ndash; now much older than the rug rats of - 2000 introduced me to ARMA 3. &nbsp;I was hooked; the flare of my beloved SoF had been resurrected in stunning 1080p running at 60fps.\r\n&nbsp;\r\nNow pushing 50 I find myself once again a noob in the FPS world. &nbsp;I&rsquo;m thankful for finding the TAW community and look forward to becoming a better player with a supportive team. &nbsp;Perhaps my IT skills can be put to use in order to make up for my lack of a twenty year olds reflexes and eidetic memory of military weaponry.\r\n&nbsp;\r\nDivadSesom [AM 1] out'),(1283,'Docktor','SGT',76561198065598322,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.01.20/4TVK47Z8CKQ8.jpg','active','2015-07-13 00:00:00','2016-09-18 13:36:22','',''),(1284,'DukeNukeM','SSG',76561198027381735,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.00.95.50/4TJKF79RPIOY.png','active','2009-12-03 00:00:00','2016-09-18 13:36:25','sg',''),(1285,'Hawkins','SSG',76561197960862264,'http://taw.net/resized-image.ashx/__size/200x200/__key/Commun