ge.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.76.42/4TXUYVGUU1JI.jpg','active','2016-04-04 00:00:00','2016-09-18 13:38:36','nl',''),(1305,'Denness','SGT',76561198081078634,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.76.74/4TZ52DFHC188.png','active','2016-04-11 00:00:00','2016-09-18 13:38:07','gb','Diary Of A Denness\r\n\r\n\r\n---What Am I---\r\n-- I am a medic/marksman specialist and devote most of time to learning how to get even better at sniping and keeping people alive.\r\n&nbsp;\r\n-- I have also been thinking for a long time that a very large interest of mine is going into the military for real i will hopefully doing a PRMC soon, just got to organise a few things at the moment with my family as my parents are split up so sometimes i have a few problems at home i live by the idea of never living by bad times always live by the good things that you can make happen no regrets and always look forward :)\r\n&nbsp;\r\n-- The things i do and try to represent inside ARMA Division are the ideologies that id like to represent in real life eventually as i am also very interested in being a real life marksman my previous experience with military has been the cadet core in the uk i was inside the PWRR regiment of the cadet core (meaning most of the things we did were normal infantry things like bush-craft and patrol exercises etc)\r\n\r\n\r\n---Deployment History---\r\n- -&nbsp;Started in Romeo (under Xsage).\r\n- -&nbsp;Joined Mech 1 (under Wicky).\r\n- -&nbsp;Became a awesome FL in Mech 1 (under Wicky).\r\n- -&nbsp;Did Exams And Rejoined Mech 1 (I used to be a very unorganised person &lt;3) .\r\n- -&nbsp;RIP Mech 1 and joined Mech 2 (Under PREACHr).\r\n- - Moved into Romeo as FL (Under Xsage)'),(1306,'LORDZIm','SGT',76561197980314673,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.24.17/4TWCN2MWQ6GO.jpg','active','2015-10-10 00:00:00','2