anged to Mechanized Squad (as Squadleader)'),(1323,'dutchwarrior','SSG',76561198007180239,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.06.49.02/4TZ5NB97LFM1.jpg','active','2015-02-24 00:00:00','2016-09-18 13:38:19','nl',''),(1324,'AgentJaded','LCP',76561197976195751,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.06.39.84/4TUBSXE6TR8I.jpg','active','2015-01-27 00:00:00','2016-09-18 13:38:26','ca',''),(1325,'bigboom','SGT',0,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.04.01.13/4TUGX4WRXNJQ.jpg','active','2012-12-26 00:00:00','2016-09-18 13:38:28','nl',''),(1326,'Duffii','SGT',76561198177043786,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.67.15/4TXOP1RDQ2V8.jpg','active','2016-03-09 00:00:00','2016-09-18 13:37:25','de',''),(1327,'mcFlaw','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1328,'Redsword','MAJ',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1329,'Samblues','CPT',76561198046231875,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.04.81.49/4TYC7HJC1F5G.png','active','2013-08-09 00:00:00','2016-09-18 13:35:13','gb','I&#39;m Sam. I like lots of different games and enjoy playing with people.&nbsp;\r\nCame to TAW with my IRL friend Sidthesloth to fly the jets in the Arma 2 domination server and stuck around :D&nbsp;\r\n&nbsp;\r\nBeen in positions when i&#39;m needed but i&#39;m always happy to help.\r\n&nbsp;\r\nPositions And Movement In Order:\r\n1. Requested to be a Drill instructor\r\n2. Became unofficial role of Head Drill instructor for hard work\r\n3. Became Staff Officer\r\n4. Transferred to League Of Legends&nbsp;\r\n5. Went On Leave and Later Discharged.\r\n6. Reinstated Into Arma, became Server technician\r\n7. Became Drill instructor (As well as ST)\r\n8. Became Squad leader (As well as ST &amp; DI)\r\n9. Rewarded for doing three jobs to a high level\r\n10. Became Platoon Leader because squad changed into a Platoon and later back into a Squad (to SL)\r\n11. Promoted to Gunnery Sergeant for hard work\r\n12. Became SO again (making me have to leave ST and DI though i still did work the box)\r\n13. Assigned as temp XO along with SO - Rewarded for hard work with a medal\r\n14. Covering CO, XO and SO and rewarded with a medal\r\n15. Promoted to First Lieutenant&nbsp;\r\n16. Transferred to Squad to spin it up\r\n17. Became Staff Officer of Squad\r\n18. Honourable discharge\r\n19. Reinstatement into Arma 3\r\n20. Regular member, enjoying Arma 3 as always.\r\n21. I&#39;m now CO, hoping to make a positive long term impact on the A3 Division/2nd Bat\r\n&nbsp;'),(1330,'Sidthesloth','2LT',0,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.04.77.08/4TW3570PB8WY.png','active','2013-08-08 00:00:00','2016-09-18 13:35:16','gb-eng',''),(1331,'Raggy','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1332,'Dostojetski','MGS',0,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.04.27.59/4TU6V8BV4PHE.png','active','2013-03-04 00:00:00','2016-09-18 13:35:18','fi','Played OFP Cold War Crisis -&gt; OFPR -&gt; ARMA -&gt; ARMA 2 -&gt; Arma 3 and still feel like a newb.\r\nJoined TAW, killed own squad with a 203, feel like a newb.\r\nSkip a few years feeling like a newb.\r\nBeen in TAW for a long time and still feel like a newb\r\nFL like a newb.\r\nSL like a newb.\r\nPL like a newb.\r\nAnd through a series of unfortunate events(RL) fell back into a squad member but at least I dont feel like a newb anymore(Although I totally am)\r\nAnd then, the newbiest of FSs enters the game. And as the saying goes &quot;If you cant do, teach.&quot; So have no fear, a newb TS is here.\r\n&nbsp;\r\nTL;DR\r\nHi everyone, Im a newb.\r\n&nbsp;\r\nPS. Definition of a newb\r\n&quot;A term used to describe a inexperienced gamer/person/etc. Unlike a noob, a newb is someone who actually wants to get better.&quot;\r\n&nbsp;\r\n&ldquo;Taking a new step, uttering a new word, is what people fear most.&rdquo;\r\n  \r\n&ldquo;Right or wrong, it&#39;s very pleasant to break something from time to time.&rdquo;\r\n\r\n    Fyodor Dostoyevsky'),(1333,'fijapowa','2LT',76561198044447933,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.03.57.41/4TYQWNWJQKPI.jpg','active','2012-07-19 00:00:00','2016-09-18 13:37:56','se','&nbsp;Never forget what you are. The rest of the world will not. Wear it like armour, and it can never be used to hurt you.\r\n&nbsp;'),(1334,'EyelessCamper','MGS',76561198012717127,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.61.18/4TYODHF0SVQB.jpg','active','2016-02-20 00:00:00','2016-09-18 13:35:20','se',''),(1335,'Ionide','CPL',0,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.07.33.29/4TZ7FVYNQBBG.jpg','active','2015-11-22 00:00:00','2016-09-18 13:38:38','es',''),(1336,'tudy','LTC',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1337,'ReconDK','CPT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1338,'Hefty','CPT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1339,'Neoken','SGM',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1340,'Kash','1LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1341,'Artemiss','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1342,'AstroFlux','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1343,'Howl','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1344,'HunterRalph','PFC',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1345,'IPFreely','',0,'','unknown','00