'unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1994,'kevlartoo','MGN',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1995,'ISCTESTUSER','MGN',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1996,'SoonerOKC','GEN',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1997,'primestick','LTC',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1998,'TigerFang','MAJ',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(1999,'leroydev','1LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2000,'HiveFive','PFC',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2001,'inergy','1LT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2002,'KingExotic','LTC',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2003,'LastElf','1SG',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2004,'richster','CPT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2005,'Adamkhor','CPT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2006,'CURT','MSG',76561198046562196,'http://taw.net/resized-image.ashx/__size/200x200/__key/CommunityServer.Components.Avatars/00.00.04.56.96/4TW0D80WP05R.jpg','active','2013-06-01 00:00:00','2016-09-18 13:38:34','gb','Positions Held:\r\n\r\n\r\nPublic Information Officer (Arma Division)\r\nExecutive Officer&nbsp;(Arma Division &amp; Star Citizen)\r\nStaff Officer&nbsp;(Arma Division)\r\nTraining Specialist&nbsp;(Arma Division &amp; Minecraft Division)\r\nPlatoon Leader&nbsp;(Arma Division)\r\nSquad Leader&nbsp;(Arma Division)\r\nFireteam Leader&nbsp;(Arma Division)\r\nDrill Instructor&nbsp;(Arma Division, Minecraft Division &amp; Star Citizen Division)\r\nTraining Instructor&nbsp;(Arma Division &amp; Minecraft Division)\r\n\r\n\r\n&nbsp;\r\n&nbsp;\r\n&nbsp;\r\nMy name is Curtis however I am nicknamed CURT. I live in the heart of England and &nbsp;play rugby close to every day of my life and training the rest. I found TAW through Arma 2 and from day one, knew it was the place for me. Ever since then I have wanted to help the community and improve everyone&#39;s improvement and always thrive on a strong work ethic. I hope over my time in TAW and Arma especially people have benefited from my work and that over the coming years I am in TAW people will always see the good and will always help me to improve TAW in everything that we do as a community.&nbsp;\r\nI am studying geography to go onto do a Maritime Science degree.\r\n&nbsp;\r\nWhere I have been in TAW:\r\nI joined TAW in the ArmA division then once I became a full member I always wanted to become a DI. I stayed as Di for a long time making head DI a couple of months later. Later on in TAW I became a SO, where I received my two Medals Of Excellence. I stayed a while as SO until getting a promotion to XO. I didn&#39;t stay in XO very long due to the fact that at that time I was the only member of command. We had two new members join us who had both previously worked together so I made the decision to step back down to SO. I unfortunately had some real life problems and very bad injuries where I was nearly paralyzed from head down due to a Rugby injury that crushed my spine. Which meant I stepped down to TI and eventually did not have the time and transferred over to MC until I was able to move back to Arma.&nbsp; In MC I held the position of Drill Instructor. I was lucky enough to be one of the few starting the Training Team as a TI and I eventually held the rank of TS. I moved back to ArmA as my real life calmed down a bit enabling me to move back to the Division I love, I then went on to start and lead our specialized air unit Sierra building up a strong group of guys emphasizing our friendship and reliance of each other being there which gave us the highest squad attendance of 96% for a series of months. I moved to lead 3rd Platoon in charge of the Sierra Air Squad and Echo specialized forces unit. I also held the position of DI as improving Arma for the better will always be my key goal in TAW. Back in DI this is also where I picked up my third Medal of Excellence creating a new Recruitment System. I was in the PIO position managing all media and wiki pages of Arma. I love every moment of it. However due to personal circumstances I was not able to stay there or in Arma. I moved to Star Citizen as I could not attend Arma Sunday Events where I took XO and helped put the leadership training and foundation in place for them to build the EU Battalion on. When I was able to move back to Arma I did so and not hold the TS position training all the members to be the best they can be and enhance the entertainment of their gameplay. Once my schedule was sorted. I rejoined the Division I have always loved and will do for years to come here in Arma. I am currently the Training Specialist within Arma and hope to benefit the Division in every possible way I can and hope to move through the ranks in time to come.'),(2007,'kareltjee','CPT',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2008,'MrHazz','COL',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2009,'NSIMS','LTC',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2010,'Remo','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2011,'Tallex','GSG',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2012,'ThatDudeFromTv','',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2013,'Domanator','MGN',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2014,'TOMAMOKO','GEN',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2015,'QuinoaAOC','COL',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2016,'Bones','GEN',0,'','unknown','0001-01-01 00:00:00','0001-01-01 00:00:00','',''),(2017,'bagger','COL',0,'','unknown','0001-01-01 00:00:0